import React, {Component} from 'react';
import Ingred_selection from './ingred_selection';
import Buying_choice from './buying_choice';

class home extends Component{


    render(){
        return(
            <div>
                <header>
                    <nav></nav>                
                    Test Text Home
                </header>
            <header/>
            <body>

            <Ingred_selection/>
            <Buying_choice/>

            </body>
            </div>
        )
    };
};

export default home;
